import { Link } from "react-router-dom";
import styles  from "./Landing.module.css";
import LandingImage2 from "./6657-cachorros.jpg"
const Landing = () => {
    return (
        <div className='intro' style={{ height: '100vh' }}>
            <Link to={'/home'}>
                <div className="overlay"></div>
                <div className="content">
                    <h1 className={styles.title}>Hi! Welcome to the henry PI Food</h1>
                    <h2 className={styles.by}>Developed by: Maria Elizabeth Ortiz </h2>
                    <h2 className={styles.start}>click here to start</h2>
                </div>
                <img
                alt="imageDog"
                    src={LandingImage2}

                    style={{
                        position: 'absolute',
                        top: 0,
                        left: 0,
                        width: '150%',
                        height: 'auto',
                        objectFit: 'cover',
                        zIndex: -1,  // Coloca el video detrás del contenido

                    }}


                />
            </Link>
        </div>
    )
}

export default Landing
